import "package:cardano_dart_types/cardano_dart_types.dart";
import "package:test/test.dart";

import "test_utils/fixtures.dart";

void main() async {
  debugAssertEnabled = true;
  group("CardanoTransaction", () {
    group("no change on re-encoding and tx body hash matches original", () {
      for (final testData in _TestCaseTx.values) {
        test(testData.name, () async {
          final reEncodedCbor = testData.cborHex.cborDecode().hexEncode();
          // mismatched cbor here means issue with cbor library
          expect(reEncodedCbor, testData.cborHex);

          final tx = CardanoTransaction.deserializeFromHex(testData.cborHex);
          final reEncoded = tx.serializeHexString();
          expect(tx.body.originalBlake2bHash256, isNotNull);
          expect(tx.body.computeBlake2bHash256().hexEncode(), tx.body.originalBlake2bHash256);
          expect(reEncoded, testData.cborHex);
        });
      }
    });

    test(
      "hash is constant",
      () {
        final tx = CardanoTransaction(
          overrideBodyMetadataHash: false,
          body: CardanoTransactionBody.create(
            networkId: null,
            referenceInputs: null,
            collateralReturn: null,
            requiredSigners: null,
            totalCollateral: null,
            scriptDataHash: null,
            collateral: null,
            inputs: const CardanoTransactionInputs(data: [], cborTags: []),
            outputs: [],
            fee: BigInt.one,
            ttl: null,
            validityStartInterval: null,
            metadataHash: null,
            mint: null,
            certs: null,
            withdrawals: null,
            votingProcedures: null,
            proposalProcedures: null,
            currentTreasuryValue: null,
            donation: null,
          ),
          witnessSet: emptyWitnessSet,
          isValidDi: true,
          auxiliaryData: CBORMetadata(value: const CborNull(tags: [22])),
        );

        expect(tx.hashCode, tx.hashCode);
      },
    );
  });
}

